import React, { Component } from "react";

class RandomQuote extends Component {
  fetchQuote() {
    fetch("https://type.fit/api/quotes")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        console.log(json);
      })
      .catch((err) => {
        console.error(err);
      });
  }

  render() {
    const quote = this.fetchQuote();

    return <div>{quote}</div>;
  }
}

export default RandomQuote;
